import React from 'react';
  import MovieBlock from '../Utility/MovieBlock';

  function MoviesList({ movies, onDelete }) {
    return (
      <div id="movies">
        {movies.map(movie => <MovieBlock key={movie._id} movie={movie} deleteMovie={onDelete}/>)}
      </div>
    )
  };

  export default MoviesList;
